import './App.css';
import {useEffect, useState} from 'react'
import ethers from 'ethers'

function App(props) {

  //const [temp1, setTemp1] = useState(0)
  //const [accounts, setAccounts] = useState([])

  function connectTO()
  {
    const ethereum = window.ethereum;
    if(ethereum)
    {
      let value = '';

      ethereum.request({method: 'eth_requestAccounts'})
      .then(result => 
      {
        console.log(result[0])
        value = result[0]
      })

      ethereum.request({method: 'eth_getBalance', params: [value, 'latest']})
      .then(result => 
      {
        console.log(result)
      })

    }
    else
    {
      console.log("no metamask")
    }
  }

  return (
    <div className="App">
      <h1> {props.somtheing} </h1>
      <button onClick={connectTO}> buton magic </button>
    </div>
  );
}

export default App;
